import React, { useState, useEffect } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Button, Modal } from "react-bootstrap";

function AdminPage() {
  const [show, setShow] = useState(false);
  const [data, setData] = useState([]);
  const [formData, setFormData] = useState({
    nume: "",
    prenume: "",
    pozitie: "",
    departament: "",
    salariu: 0,
    nivelStudii: "",
    cnp: "",
    username: "",
    password: "",
    isAdmin: false,
    isAgentVanzari: false,
    isContabil: false,
    isLucratorService: false,
  });

  const handleClose = () => {
    setShow(false);
    setFormData({
      nume: "",
      prenume: "",
      pozitie: "",
      departament: "",
      salariu: 0,
      nivelStudii: "",
      cnp: "",
      username: "",
      password: "",
      isAdmin: false,
      isAgentVanzari: false,
      isContabil: false,
      isLucratorService: false,
    });
  };

  const handleShow = () => setShow(true);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Make a POST request to your API endpoint
    fetch("http://localhost:5036/api/DateCompleteAngajat", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(formData),
    })
      .then((response) => {
        if (response.ok) {
          handleClose();
          // You can add additional logic here, such as showing a success message
        } else {
          // Handle errors here
        }
      })
      .catch((error) => console.error("Error making POST request:", error));
  };

  useEffect(() => {
    // Fetch data from your API endpoint
    fetch("http://localhost:5036/api/DateCompleteAngajat")
      .then((response) => response.json())
      .then((data) => setData(data))
      .catch((error) => console.error("Error fetching data:", error));
  }, []);

  return (
    <div className="container">
      <div className="crud shadow-lg p-3 mb-5 mt-5 bg-body rounded">
        <div className="row">
          <div className="col-sm-3 mt-5 mb-4 text-gred">
            <div className="search">
              <form className="form-inline">
                <input
                  className="form-control mr-sm-2"
                  type="search"
                  placeholder="CNP"
                  aria-label="Search"
                />
              </form>
            </div>
          </div>
          <div className="col-sm-3 offset-sm-2 mt-5 mb-4 text-gred">
            <h2 style={{ color: "black" }}>
              <b>Angajati</b>
            </h2>
          </div>
          <div className="col-sm-3 offset-sm-1 mt-5 mb-4 text-gred">
            <Button variant="primary" onClick={handleShow}>
              Adaugare angajat
            </Button>
          </div>
        </div>
        <div className="row">
        <div className="table-responsive">
          <table className="table table-striped table-hover table-bordered custom-table">
            <thead>
              <tr>
                <th>Id</th>
                <th>Nume</th>
                <th>Prenume</th>
                <th>Pozitie</th>
                <th>Departament</th>
                <th>Salariu</th>
                <th>Nivel Studii</th>
                <th>CNP</th>
                <th>Username</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {data.map((employee) => (
                <tr key={employee.id}>
                  <td>{employee.id}</td>
                  <td>{employee.nume}</td>
                  <td>{employee.prenume}</td>
                  <td>{employee.pozitie}</td>
                  <td>{employee.departament}</td>
                  <td>{employee.salariu}</td>
                  <td>{employee.nivelStudii}</td>
                  <td>{employee.cnp}</td>
                  <td>{employee.username}</td>
                  <td>
                    <a href="#" className="view" title="View" data-toggle="tooltip">
                      <i className="material-icons">&#xE417;</i>
                    </a>
                    <a href="#" className="edit" title="Edit" data-toggle="tooltip">
                      <i className="material-icons">&#xE254;</i>
                    </a>
                    <a href="#" className="delete" title="Delete" data-toggle="tooltip">
                      <i className="material-icons">&#xE872;</i>
                    </a>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>

        {/* <!-- Model Box --> */}
        <div className="model_box">
          <Modal show={show} onHide={handleClose} backdrop="static" keyboard={false}>
            <Modal.Header closeButton>
              <Modal.Title>Adaugare angajat</Modal.Title>
            </Modal.Header>
            <Modal.Body>
              <form>
                <div className="form-group">
                  <input type="email" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter Name" />
                </div>
                <div className="form-group mt-3">
                  <input type="email" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter Country" />
                </div>
                <div className="form-group mt-3">
                  <input type="email" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter City" />
                </div>
                <div className="form-group mt-3">
                  <input type="password" className="form-control" id="exampleInputPassword1" placeholder="Enter Country" />
                </div>

                <button type="submit" className="btn btn-success mt-4">Adaugare</button>
              </form>
            </Modal.Body>

            <Modal.Footer>
              <Button variant="secondary" onClick={handleClose}>
                Inchidere
              </Button>
            </Modal.Footer>
          </Modal>

          {/* Model Box Finish */}
        </div>
      </div>
    </div>
  );
}

export default AdminPage;
